import Navbr from './component/Navbr';
import Routers from './component/Routers'
import { Route } from 'react-router';
import ShowUser from './component/ShowUser';
import './App.css';

function App() {
  return (
    <>
    <Navbr></Navbr>
    <div className="App">
    <Routers/>
    <Route path="/"><ShowUser></ShowUser></Route>
    </div>
    </>
  );
}

export default App;
